export const gqlQuery = `query pokemons($limit: Int, $offset: Int) {
  pokemons(limit: $limit, offset: $offset) {
    count
    next
    previous
    status
    message
    results {
      url
      name
      image
    }
    ability(ability: $ability) {
    params
    status
    message
    response
  }
  }
}`;
